const t=[{id:"imp-3",question:"Why must Condensation Silicone impressions be poured immediately/soon?",options:["Hydrogen gas causes voids","Water absorption causes swelling","Ethanol by-product evaporates causing shrinkage","Platinum catalyst continues curing for 24 h"],correctAnswerIndex:2,explanation:"Condensation silicone releases ethyl alcohol; evaporation → dimensional shrinkage."},{id:"imp-5",question:"Which material is naturally hydrophilic and works well in moisture but should not be stored in water?",options:["Condensation silicone","Addition silicone (PVS)","Polyether","Impression compound"],correctAnswerIndex:2,explanation:"Polyether is inherently hydrophilic (good in moisture) but absorbs water (imbibition) if stored in liquid."},{id:"imp-6",question:"Which alginate powder component acts as a retarder to provide working time?",options:["Calcium sulfate","Trisodium phosphate","Potassium titanium fluoride","Diatomaceous earth"],correctAnswerIndex:1,explanation:"Phosphate preferentially ties up Ca²⁺ first; alginate crosslinking starts after phosphate is depleted."},{id:"imp-new-1",question:"In alginate impression material, which component is the main soluble hydrocolloid that reacts with calcium ions to form the elastic gel?",options:["Calcium sulfate","Sodium alginate","Diatomaceous earth","Trisodium phosphate"],correctAnswerIndex:1,explanation:"Sodium alginate dissolves in water to form the sol and reacts with calcium ions to form the calcium alginate gel."},{id:"imp-16",question:"Polyether stiffness compared to other elastomers is best described as:",options:["Lowest modulus; easiest removal","High modulus; difficult removal from undercuts","Similar to polysulfide; very flexible","Only stiff before set, soft after set"],correctAnswerIndex:1,explanation:"Polyether is classically the stiffest elastomer (high modulus), harder to remove from undercuts."},{id:"imp-22",question:"You are a clinical supervisor... patient has developed acute redness, swelling, and itching (signs of contact dermatitis/hypersensitivity)... Among the elastomeric materials, which one is the most likely culprit for this allergic reaction?",options:["Addition Silicone (PVS)","Polysulfide","Polyether","Condensation Silicone"],correctAnswerIndex:2,explanation:"Polyether. Short reasoning: Polyether is the elastomer most commonly linked to allergic/contact reactions compared with silicones and polysulfide."},{id:"imp-24",question:"Primary function of diatomaceous earth in alginate powder:",options:["Retarder","Reactor source of Ca²⁺","Filler increasing strength","Photoinitiator"],correctAnswerIndex:2,explanation:"It provides body and improves strength and rigidity."},{id:"imp-27",question:"A dentist is using a condensation silicone... what is the best time window to pour the stone cast to minimize dimensional inaccuracy?",options:["After 1 hour to allow for elastic recovery","After 24 hours to ensure full polymerization","Immediately or within 15–30 minutes","After 1 week, similar to PVS"],correctAnswerIndex:2,explanation:"Immediately or within 15–30 minutes. Justification: Condensation silicone undergoes a condensation reaction that releases ethanol. Ethanol evaporates quickly, producing significant shrinkage..."},{id:"imp-28",question:"Why is zinc oxide–eugenol (ZOE) impression paste generally unsuitable for recording the fine details of a crown preparation?",options:["It is too fluid to stay in the tray.","It reacts with the temporary crown material.","It is inelastic and may fracture/lock in undercuts during removal.","It sets too slowly."],correctAnswerIndex:2,explanation:"It is inelastic and will fracture/lock in undercuts. Justification: ZOE sets into a rigid, inelastic material..."},{id:"imp-29",question:"Which component in polysulfide impression material is responsible for its characteristic dark brown color (and associated staining)?",options:["Titanium dioxide","Sulfur","Dibutyl phthalate","Lead dioxide (PbO₂)"],correctAnswerIndex:3,explanation:"Lead dioxide (PbO₂). Justification: In polysulfide impression materials, lead dioxide (PbO₂) is present in the accelerator/catalyst paste..."},{id:"imp-32",question:"Which impression material releases water as a by-product during its setting reaction, meaning the impression should be poured within about 30–60 minutes to reduce dimensional change (shrinkage)?",options:["Polysulfide","Addition silicone (PVS)","Polyether","Impression compound"],correctAnswerIndex:0,explanation:"Polysulfide. Justification: Polysulfide sets via a condensation reaction... produces water as a by-product..."},{id:"imp-33",question:"What is the primary role of Diatomaceous Earth in an alginate impression powder?",options:["It acts as a filler to provide stiffness and strength.","It acts as a retarder.","It acts as a reactor.","It provides the dustless coating."],correctAnswerIndex:0,explanation:"It acts as a filler to provide stiffness and strength. Justification: Diatomaceous earth makes up the bulk of alginate powder (often ~50–60%)..."},{id:"imp-34",question:"Which property of Polyether impression material makes it difficult to remove from the mouth, especially in undercut areas?",options:["High plasticity","High stiffness (high modulus of elasticity)","High tear strength","Low surface tension"],correctAnswerIndex:1,explanation:"High stiffness (high modulus of elasticity). Statement (key concept): Polyether sets into a very rigid elastomer..."},{id:"imp-38",question:"Which impression material shows hysteresis, meaning there is a temperature gap between liquefaction (sol) and gelation (gel) temperatures?",options:["Impression Compound","Polyether","Agar","Alginate"],correctAnswerIndex:2,explanation:"Agar. Statement (key concept): Agar (reversible hydrocolloid) demonstrates thermal hysteresis..."},{id:"imp-40",question:"If an Alginate impression is removed from the mouth and left on the countertop for 1 hour in dry air, it will distort primarily due to:",options:["Polymerization shrinkage","Thermal expansion","Imbibition","Syneresis and evaporation"],correctAnswerIndex:3,explanation:"Syneresis and evaporation. Statement (key concept): Alginate (an irreversible hydrocolloid) is a water-based gel..."},{id:"imp-41",question:"Which impression material is most likely to produce hydrogen gas as a side effect?",options:["Addition Silicone (PVS)","Polysulfide","Condensation Silicone","Polyether"],correctAnswerIndex:0,explanation:"Addition Silicone (PVS). Statement (key concept): Addition silicone (PVS) sets by an addition (hydrosilylation) reaction. Some formulations can release hydrogen gas (H₂)..."}],n=[{id:"imp-1",question:"Addition Silicone (PVS) sets everywhere except the margin (margin is gooey). Most likely cause?",options:["Too much tray adhesive","Ethanol by-product evaporation","Sulfur contamination inhibited polymerization","Water contamination accelerated setting"],correctAnswerIndex:2,explanation:"Platinum catalyst in PVS can be “poisoned” by sulfur (latex gloves / some cords), so the contaminated area stays unset."},{id:"imp-2",question:"Which phenomenon explains: flows easily through syringe under stress but doesn’t drip off tray at rest?",options:["Thixotropy","Viscoelasticity","Pseudoplasticity","Syneresis"],correctAnswerIndex:2,explanation:"Pseudoplasticity (shear thinning) = viscosity drops immediately under shear and recovers immediately when stress stops."},{id:"imp-4",question:"Why is “snap” (quick jerk) removal recommended for elastomeric impressions?",options:["Prevents tearing by increasing viscosity","Minimizes permanent plastic deformation from viscoelastic flow","Increases wetting on the tooth","Prevents hydrogen bubbles"],correctAnswerIndex:1,explanation:"Fast strain favors elastic recovery; slow removal allows viscous flow → permanent distortion."},{id:"imp-7",question:"Patient has very mobile teeth / severe periodontal undercuts. Which material should be avoided due to high stiffness?",options:["Alginate","Polysulfide","Polyether","Agar"],correctAnswerIndex:2,explanation:"Polyether has a high modulus (stiff), risking locking into undercuts or even extracting mobile teeth."},{id:"imp-10",question:"Agar tray material left too long in tempering bath (>10 min). Primary consequence?",options:["Increased tear strength","Early gelation in tray","Ethanol evaporation","Inhibition by sulfur"],correctAnswerIndex:1,explanation:"Partial gelation in tray prevents flow/adaptation and interferes with bonding to syringe material."},{id:"imp-12",question:"Why is agar syringe material never tempered?",options:["Tempering increases its stiffness for support","It must stay as a fluid sol to adapt and bond","It needs ethanol to evaporate","It must become thixotropic"],correctAnswerIndex:1,explanation:"It must remain fluid (sol) for adaptation; staying untempered also supports bonding with tray material."},{id:"imp-13",question:"In polysulfide, lead dioxide has which dual function?",options:["Filler + surfactant","Retarder + plasticizer","Reactor/oxidizer + provides brown color","Crosslinker + releases ethanol"],correctAnswerIndex:2,explanation:"Lead dioxide supplies oxygen for reaction and gives characteristic brown color."},{id:"imp-15",question:"Most common cause of separation between agar tray and agar syringe material?",options:["No tray adhesive applied","Syringe material was tempered","Water-soaked surface layer on tray not removed","Use of cold water circulation"],correctAnswerIndex:2,explanation:"The wet superficial layer blocks bonding if not scraped/removed."},{id:"imp-17",question:"Why does alginate compressive strength increase markedly in first ~4 minutes after gelation?",options:["Water evaporates rapidly","Ethanol by-product forms","Crosslinking continues and network matures","Plasticizer leaches out"],correctAnswerIndex:2,explanation:"Calcium-alginate network continues organizing/strengthening after initial set."},{id:"imp-19",question:"You are preparing to take a preliminary impression using Impression Compound... it had become grainy, sticky, and unworkable. What is the primary cause of this degradation?",options:["Imbibition of water causing the filler to dissolve","Leaching out of the plasticizer","Polymerization of the resin matrix due to heat","Syneresis causing surface collapse"],correctAnswerIndex:1,explanation:"Leaching out of the plasticizer (stearic acid/stearin). Short reasoning: Prolonged hot-water immersion extracts/leaches the plasticizer → compound loses proper flow/cohesion → turns grainy and sticky."},{id:"imp-25",question:"A patient reports an intense burning sensation on their lips and alveolar ridge immediately after the insertion of a custom tray loaded with Zinc Oxide Eugenol (ZOE) impression paste. What is the most likely cause?",options:["Thermal shock from the setting reaction","The acidity of the impression material","Hypersensitivity to zinc oxide","Contact stomatitis due to eugenol"],correctAnswerIndex:3,explanation:"Contact stomatitis due to eugenol. Short reasoning: Eugenol is a phenolic compound that can irritate mucosa and trigger chemical burns/contact stomatitis, causing immediate burning."},{id:"imp-26",question:"In monophase technique, viscosity decreases during syringe injection due to:",options:["Low temperature in syringe","High shear rate in narrow tip","Ethanol by-product formation","Polymer chains shortening"],correctAnswerIndex:1,explanation:"High shear rate triggers shear thinning."},{id:"imp-30",question:"During a final impression with Addition Silicone (PVS), the material fails to set only in the area adjacent to a newly placed composite core build-up... What is the most likely chemical cause?",options:["Moisture contamination from the dentin.","Inhibition (poisoning) of the platinum catalyst by residual methacrylates/tertiary amines from the composite.","Reaction with the aluminum chloride hemostatic agent.","Thermal shock from the curing light."],correctAnswerIndex:1,explanation:"Inhibition of the platinum catalyst by residual methacrylates/amines. Justification: Addition silicone (PVS) sets by a platinum-catalyzed addition reaction. Certain contaminants can poison the platinum catalyst..."},{id:"imp-31",question:"The “snap removal” (quick jerk) technique is critical when removing viscoelastic impression materials because it:",options:["Increases the flow of the material into the sulcus.","Stops the chemical reaction immediately.","Maximizes elastic recovery and minimizes viscous flow (permanent deformation).","Prevents the tearing of thin sections."],correctAnswerIndex:2,explanation:"Maximizes elastic recovery and minimizes viscous flow (permanent deformation). Justification: Viscoelastic materials behave like both a spring (elastic) and a dashpot (viscous). If you remove the impression slowly..."},{id:"imp-35",question:"Why is Agar (Reversible Hydrocolloid) considered an excellent material for crown impressions, even though it requires special conditioning equipment...?",options:["It can be poured continuously for 7 days.","It is naturally hydrophilic and captures fine detail well in moist environments.","It is rigid enough to splint implants.","It has the highest tear strength of all impression materials."],correctAnswerIndex:1,explanation:"It is naturally hydrophilic and captures fine detail well in moist environments. Statement (key concept): Agar has a high water content..."},{id:"imp-37",question:"Manufacturers add surfactants to Addition Silicone (PVS). What is the main reason for adding these surfactants?",options:["To make the material completely resistant to sulfur/latex inhibition","To significantly shorten the setting time","To make gypsum slurry and oral moisture spread better","To markedly increase tear strength"],correctAnswerIndex:2,explanation:"To make gypsum slurry and oral moisture spread better. Statement (key concept): Standard PVS is hydrophobic..."},{id:"imp-42",question:"You are making an implant-level impression for a case with multiple impression copings that are not parallel. What is the primary disadvantage of using polyether as the impression material in this situation?",options:["The material will tear upon removal.","The material will distort permanently.","The high rigidity makes removal extremely difficult and may loosen the copings or tray.","The setting time is too fast to seat the tray."],correctAnswerIndex:2,explanation:"The high rigidity makes removal extremely difficult and may loosen the copings or tray. Statement (key concept): Polyether has a high modulus of elasticity (high stiffness/rigidity)..."},{id:"imp-45",question:"During a crown impression appointment, you need an elastomeric material that offers the least working time (very short “mix + load + seat” window) and then shows a distinct snap set, leaving minimal time for manipulation. Which elastomer typically has the shortest working time?",options:["Addition Silicone (PVS) — Fast set","Polyether","Condensation Silicone","Polysulfide"],correctAnswerIndex:1,explanation:"Polyether."},{id:"imp-46",question:"A border-molding impression is being made with Impression Compound. The tray is removed from the mouth before the compound has fully cooled to oral temperature. What is the most likely consequence?",options:["It will expand rapidly.","It will undergo plastic deformation (drag/distortion).","It will be too brittle and fracture.","It will adhere to the teeth."],correctAnswerIndex:1,explanation:"It will undergo plastic deformation (drag/distortion). Statement (key concept): Impression compound is a thermoplastic material..."},{id:"imp-new-2",question:"In alginate impression material, which ingredient makes up the largest percentage by weight of the powder (i.e., the main bulk/filler component)?",options:["Sodium alginate","Calcium sulfate","Diatomaceous earth","Trisodium phosphate"],correctAnswerIndex:2,explanation:"Diatomaceous earth is the main filler (~50–60% by weight). It provides bulk, strength, and improves handling but does not participate in the gel-forming reaction."}],o=[{id:"imp-8",question:"In cationic polymerization of polyether, which component functions as the initiator?",options:["Platinum salt","Stannous octoate","Aromatic sulfonate ester","Trisodium phosphate"],correctAnswerIndex:2,explanation:"Aromatic sulfonate ester generates cations that open aziridine rings, initiating polymerization."},{id:"imp-9",question:"Why can polysulfide show high Tear Energy despite being prone to distortion?",options:["It is very rigid (high modulus)","It produces ethanol by-product","It can elongate greatly (high λ) before tearing","It is hydrophilic and absorbs water"],correctAnswerIndex:2,explanation:"Tear Energy accounts for extension; polysulfide stretches a lot before tearing (high λ), though it may distort permanently."},{id:"imp-11",question:"Impression compound distortion due to “relaxation” is worsened mainly by:",options:["High hydrophilicity","Low thermal conductivity","High contact angle","Hydrogen gas evolution"],correctAnswerIndex:1,explanation:"Outer cools/hardens first while inside stays hot; later internal cooling causes contraction/stress → distortion (relaxation)."},{id:"imp-14",question:"Polyether stored in water swells (imbibition). What simultaneous process degrades properties?",options:["Ethanol evaporation","Leaching of water-soluble plasticizer","Platinum poisoning","Syneresis"],correctAnswerIndex:1,explanation:"Water uptake occurs while plasticizer leaches out, altering flexibility and accuracy."},{id:"imp-18",question:"In addition silicone reaction, which group reacts with the vinyl group?",options:["–OH terminal group","–SH group","Si–H group","Phosphate group"],correctAnswerIndex:2,explanation:"Si–H on polymethylhydrosiloxane adds across vinyl groups (Pt-catalyzed)."},{id:"imp-20",question:"To reduce hydrogen gas voids in gypsum casts from PVS, manufacturers add:",options:["Borax","Palladium","Trisodium phosphate","Potassium titanium fluoride"],correctAnswerIndex:1,explanation:"Noble metals (commonly palladium) act as hydrogen scavengers."},{id:"imp-21",question:"A dentist takes a diagnostic alginate impression... slowly “teases” and rocks the tray out... the abutment teeth are slightly wider and distorted compared to reality. What is the most likely cause of this distortion?",options:["The slow removal allowed the alginate to absorb saliva (imbibition).","The slow removal caused permanent deformation because alginate is viscoelastic.","The alginate tore internally because the tear strength was exceeded.","The slow removal caused syneresis (water loss) due to prolonged air exposure."],correctAnswerIndex:1,explanation:"The slow removal caused permanent deformation because alginate is viscoelastic. Short reasoning: Slow removal allows time-dependent viscous flow → permanent set → teeth on the cast appear distorted/wider."},{id:"imp-23",question:"In condensation silicone, the alkyl silicate primarily acts as:",options:["Plasticizer","Cross-linking agent","Hydrogen scavenger","Retarder"],correctAnswerIndex:1,explanation:"Alkyl silicate reacts with terminal –OH groups to create the 3D network."},{id:"imp-36",question:"Which disinfectant is commonly recommended for Zinc Oxide–Eugenol (ZOE) impression paste but is NOT typically preferred for hydrocolloids...?",options:["Alcohol immersion","2% Glutaraldehyde (Alkaline)","Boiling water","Chlorine compounds"],correctAnswerIndex:1,explanation:"2% Glutaraldehyde (Alkaline). Statement (key concept): Glutaraldehyde is effective for ZOE..."},{id:"imp-39",question:"Why is Potassium Sulfate added to the setting bath or formulation of Agar (reversible hydrocolloid)...?",options:["To counteract the retarding effect of borax/sol on the gypsum surface.","To increase the shelf life.","To improve taste.","To act as a retarder for the impression."],correctAnswerIndex:0,explanation:"To counteract the retarding effect of borax/sol on the gypsum surface. Statement (key concept): Borax in agar acts as a strengthener, but it can retard the setting of gypsum..."},{id:"imp-43",question:"A clinician places a ferric sulfate hemostatic agent around the gingival sulcus before making an impression with Addition Silicone (PVS). The area is not rinsed thoroughly and the impression is taken. What is the most likely outcome?",options:["It dissolves the filler particles.","The sulfur in the ferric sulfate inhibits the platinum catalyst.","The iron stains the impression black.","It accelerates the setting reaction violently."],correctAnswerIndex:1,explanation:"The sulfur in the ferric sulfate inhibits the platinum catalyst. Justification (why B is correct): If a hemostatic agent residue is left on the tooth/gingiva, it can interfere with PVS polymerization..."},{id:"imp-44",question:"After removing an elastomeric impression from a mouth with mild undercuts, you notice the impression shows shape change that does not fully rebound back (i.e., highest permanent deformation / lowest elastic recovery after strain). Which elastomer is most likely to show this behavior?",options:["Condensation Silicone","Polysulfide","Polyether","Addition Silicone (PVS)"],correctAnswerIndex:1,explanation:"Polysulfide. Statement (key concept): Permanent deformation in elastomers happens because the material has a viscous (flow) component..."}];export{e as I,i as a,n as b,t as c,o as d};
